import React from 'react';
import { useNavigate } from 'react-router-dom'; // Import useNavigate
import VideoFeed from '../components/videofeed.js'; // Import the VideoFeed component

const Home = () => {
  const navigate = useNavigate(); // Initialize navigate function

  return (
    <div className="home">
      <VideoFeed /> {/* Embed the video feed */}
      <div class='menu-bar'>
        <button onClick={() => navigate('/')} className="menu-button">
          <i className="fa-solid fa-house"></i> Home
        </button>
        <button onClick={() => navigate('/profile')} className="menu-button">
          <i className="fa-solid fa-user"></i> Profile
        </button>
      </div>
    </div>
  );
};

export default Home;
